CREATE TABLE races(
   raceId      INTEGER  NOT NULL PRIMARY KEY 
  ,year        INTEGER  NOT NULL
  ,round       INTEGER  NOT NULL
  ,circuitId   INTEGER  NOT NULL
  ,name        VARCHAR(29) NOT NULL
  ,date        DATE  NOT NULL
  ,time        VARCHAR(8)
  ,url         VARCHAR(63) NOT NULL
  ,fp2 date    DATE 
  ,fp2 time    VARCHAR(8)
  ,fp3 date    DATE 
  ,fp3 time    VARCHAR(8)
  ,quali date  DATE 
  ,quali time  VARCHAR(8)
  ,sprint date DATE 
  ,sprint time VARCHAR(8)
);
